class Footer extends Component{
    render(){
        return(
       <div>
           <footer className="mt-3 bg-dark text-white text-center">
              <div className="row">
                  <h3>
                      <i class="fa fa-copyright" aria-hidden="true"></i>
                  </h3>
              </div>  
           </footer>
       </div>
        );
    }
}
export default Footer;
